import React, { Component } from 'react'
import { BrowserRouter as Router,
    Switch,
    Route,
    Link } from 'react-router-dom';


import '../App.css'
export class Tabs extends Component {

    render() {
        return (
            <Router>
                <nav className="tabs">
                        <a href="#">Profile</a> 
                        <a href="#">Resume/CV</a> 
                        <a href="#">Projects</a>
                        <a href="#">Referees</a>
                    </nav>
            </Router>



        )
    }
}

export default Tabs
